description:
After seeing a shadowy figure walk by her window, Amia fearfully calls the police. When Officer Sins arrives, however, the intruder is nowhere to be found, and he is furious at the young girl for wasting his time. Scared to be alone and desperate to make it up to the policeman, Amia thanks him the only way that she knows how.

